■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>毎日の健康維持に!</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5369/1043383-01.jpg" width="600" height="600"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">【販売者】<br>株式会社  ユニマットリケン<br>東京都港区南青山2-7-28<br><br>【アレルギー一覧】<br>乳、オレンジ<br><br>【お召し上がり方】<br>栄養補助食品として、1日2粒を目安に水またはぬるま湯と共にお召し上がりください。そのまま噛んでも美味しくお召し上がり頂けます。<br><br>【保存方法・注意事項】<br>※高温多湿、直射日光を避けて冷暗所に保存してください。<br>※開封後は開閉口をしっかりと閉めて保管し、お早めにお召し上がりください。<br>※体に合わない時はご使用をお止めください。<br>※最終加工地:徳島県</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">乳酸菌は、ヨーグルトや発酵食品として健康維持のために親しまれてきました。本品は、ヨーグルト10個分の乳酸菌(※)に相当する1000億個のフェカリス菌に、さらに有胞子乳酸菌ラクリス(R)、植物性乳酸菌ラブレ菌、ビフィズス菌の4種類の乳酸菌を配合した、噛んでも美味しく食べられるヨーグルト風味のタブレットです。(※)ヨーグルト1個分(100g)に乳酸菌100億個含む場合として算出</font></td></tr></table><br><!--栄養成分・原材料表ここから--><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">栄養成分</font></td><td width="75%"><font color="#333333" size="-1">1日目安量2粒(0.4g)あたり:エネルギー　1.53    kcal、たんぱく質　0.02    g、脂質　0.01g、炭水化物　0.35g、ナトリウム　0.44    mg<br>フェカリス菌　1000億個、有胞子性乳酸菌　1億個、ラブレ菌　1.6億個、ビフィズス菌　2億個        <br>※乳酸菌は製造時の菌数です。</font></td></tr><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">原材料</font></td><td width="75%"><font color="#333333" size="-1">マルチトール、乳糖、イソマルトオリゴ糖、有胞子性乳酸菌、乳酸菌末(殺菌乳酸菌、デキストリン)、ビフィズス菌末(デキストリン、殺菌ビフィスズ菌)、乳酸菌末(澱粉分解物、殺菌乳酸菌)、結晶セルロース、ステアリン酸カルシウム、二酸化ケイ素、クエン酸、香料、甘味料(スクラロース、アセスルファムカリウム)</font></td></tr></table><br><!--栄養成分・原材料表ここまで--><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">乳酸菌は、ヨーグルトや発酵食品として健康維持のために親しまれてきました。本品は、ヨーグルト10個分の乳酸菌(※)に相当する1000億個のフェカリス菌に、さらに有胞子乳酸菌ラクリス(R)、植物性乳酸菌ラブレ菌、ビフィズス菌の4種類の乳酸菌を配合した、噛んでも美味しく食べられるヨーグルト風味のタブレットです。(※)ヨーグルト1個分(100g)に乳酸菌100億個含む場合として算出</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td><td width="75%" align="left"><font color="#333333" size="-1">30.8g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：12×17×2cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：40g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">商品区分：健康食品</font><br><font color="#333333" size="-1">名称：乳酸菌含有食品</font><br> <font color="#333333" size="-1">賞味期間：製造日より720日</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
