■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>臭いが気にならない!</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5332/1022301-01.jpg" width="600" height="600"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#999999"><tr><td bgcolor="#FFFFCC"><table width="100%" border="0" cellpadding="3" cellspacing="0"><tr><th><font color="#FF0000">------&nbsp;ココがポイント！&nbsp;------</font></th></tr><tr><td><strong><font size="3" color="#FF9900">●納豆を召し上がらない方におすすめ!</font></strong></td></tr></table></td></tr></table><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">【お召し上がり方】<br>●栄養補助食品として、1日3粒を目安に水またはぬるま湯と共にお召し上がりください。<br><br>【保存方法】<br>●高温多湿、直射日光を避けて保存してください。<br>●開封後は蓋をしっかりと閉める冷暗所に保管し、お早めにお召し上がりください。<br><br>【注意事項】<br>●お体に合わない場合はご使用をおやめください。<br><br>【販売者】<br>株式会社ユニマットリケン<br>東京都港区南青山2-7-28</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">納豆菌を培養・抽出した高活性の納豆キナーゼに、イワシ、カツオ、マグロから採取生成したEPA含有精製魚油を配合。納豆に含まれるビタミンK2と独特の臭いを除去していますので納豆が苦手な方でもお召し上がりいただけます。</font></td></tr></table><br> <table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><h1><font color="#333333" size="3">健康食品/サプリメント/サプリ/ソフトカプセル/日本ナットウキナーゼ協会認定商品/におわない</font></h1></td></tr></table><br><!--栄養成分・原材料表ここから--><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">栄養成分</font></td><td width="75%"><font color="#333333" size="-1">【1日目安量3粒(1.218g)あたり】<br>エネルギー:7.72kcal、たんぱく質:0.35g、脂質:0.62g、炭水化物:0.19g、ナトリウム:0.40mg、ビタミンK2:0μg、納豆菌培養エキス末:100mg(納豆キナーゼ活性:2000FU)、EPA含有精製魚油:30mg(EPA28％含有)</font></td></tr><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">原材料</font></td><td width="75%"><font color="#333333" size="-1">大豆油(遺伝子組み換えでない)、ゼラチン(豚皮由来)、納豆菌培養エキス(難消化性デキストリン、納豆菌培養エキス末)、EPA含有精製魚油、グリセリン、大豆レシチン、グリセリン脂肪酸エステル、ミツロウ</font></td></tr></table><br><!--栄養成分・原材料表ここまで--><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">納豆菌を培養・抽出した高活性の納豆キナーゼに、イワシ、カツオ、マグロから採取生成したEPA含有精製魚油を配合。納豆に含まれるビタミンK2と独特の臭いを除去していますので納豆が苦手な方でもお召し上がりいただけます。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td><td width="75%" align="left"><font color="#333333" size="-1">24.36g(406mg×60粒)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：6×10×6cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：143g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">商品区分：健康食品</font><br><font color="#333333" size="-1">名称：納豆菌培養エキス加工食品</font><br> <font color="#333333" size="-1">賞味期間：製造日より720日</font><br></td></tr><tr bg